    console.time('用时：')
    while (index = nums.indexOf(minNum), index > -1) {
        nums.splice(index, 1)
        count += 1
        if (count === k) {
            minNum = Math.min(...nums)
            count = 0
        }
        else minNum += 1
    }
    console.timeEnd('用时：')
    return count === 0 && nums.length === 0 ? true : false
